import React from 'react';
import './WeddingParty.css';

const WeddingParty = () => {
  const weddingPartyMembers = [
    // Top row - Women
    {
      name: "Andrea Lively",
      title: "MAID OF HONOR",
      image: null // placeholder
    },
    {
      name: "Kendra Kelly", 
      title: "BRIDESMAID",
      image: null // placeholder
    },
    {
      name: "Jenny Anderson",
      title: "BRIDESMAID", 
      image: null // placeholder
    },
    {
      name: "Brooke Lively",
      title: "BRIDESMAID",
      image: null // placeholder
    },
    // Bottom row - Men
    {
      name: "Marcus Wallis",
      title: "BEST MAN",
      image: null // placeholder
    },
    {
      name: "Nathan Toth",
      title: "GROOMSMAN",
      image: null // placeholder
    },
    {
      name: "Mike York",
      title: "GROOMSMAN",
      image: null // placeholder
    },
    {
      name: "Keith Lively",
      title: "GROOMSMAN",
      image: null // placeholder
    }
  ];

  return (
    <div className="wedding-party-container">
      <h1 className="container-title" style={{ marginTop: "2rem" }}>The Crew</h1>
      <div className="wedding-party-grid">
        {weddingPartyMembers.map((member, index) => (
          <div key={index} className="wedding-party-member">
            <div className="member-image-placeholder">
              {/* Placeholder for image */}
            </div>
            <h3 className="member-name">{member.name}</h3>
            <p className={`member-title ${index < 4 ? 'pink-title' : 'green-title'}`}>
              {member.title}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default WeddingParty;
